-- | SecCSFlags
--
-- This is the type of flags arguments to Code Signing API calls.	It provides a bit mask of request and option flags. All of the bits in these	masks are reserved to Apple; if you set any bits not defined in these headers,	the behavior is generally undefined.
--
-- This list describes the flags that are shared among several Code Signing API calls.	Flags that only apply to one call are defined and documented with that call.	Global flags are assigned from high order down (31 -> 0); call-specific flags	are assigned from the bottom up (0 -> 31).
--
-- kSecCSDefaultFlags
--
-- When passed to a flags argument throughout, indicates that default behavior	is desired. Do not mix with other flags values.
--
-- kSecCSConsiderExpiration
--
-- When passed to a call that performs code validation, requests that code signatures	made by expired certificates be rejected. By default, expiration of participating	certificates is not automatic grounds for rejection.
--
-- kSecCSNoNetworkAccess
--
-- When passed to a call that performs code validation, configures the validation to	not perform any work that requires the network. Using this flag disables security features	like online certificate revocation and notarization checks by removing potentially	slow network requests that can delay evaluations. This flag has always been usable for	SecStaticCode objects and is usable with SecCode objects starting with macOS 11.3.
-- | @SecCSFlags@ (bitmask)
newtype SecCSFlags = SecCSFlags CUInt
  deriving stock (Eq, Ord, Show)
  deriving newtype (Storable, Bits, FiniteBits)

instance Semigroup SecCSFlags where
